import React from "react";
import styles from "./NavBar.module.css";
import styled from "styled-components";

const H2 = styled.h2`
  color: #fff;
`;

export default function NavBar() {
  return (
    <div className={styles.container}>
      <H2>Booking Website</H2>
    </div>
  );
}
